      "content": "// SPDX-License-Identifier: MIT

pragma solidity 0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Address.sol";

interface IPancakeRouter {
    function getAmountsIn(uint amountOut, address[] calldata path) external view returns (uint[] memory amounts);
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}

interface IRefferal {
    function userInfos(address _user) external view returns(address user,
        address refferBy,
        uint dateTime,
        uint totalRefer,
        uint totalRefer7,
        bool top10Refer);
}
interface IPoolsMatic {
    function currentReward(uint pid, address user) external view returns(uint);
    function userTotalLock(address user) external view returns(uint);
    function volumeOntree(address user) external view returns(uint);
    function childs(address user) external view returns(uint, uint);
    function users(address user, uint pid) external view returns(uint, uint, uint, uint);
    function usersV1(address user, uint pid) external view returns(uint, uint, uint, uint);
    function userClaimed(address user, uint pid, uint index) external view returns(uint, uint, uint, uint);
    function getUsersClaimedLength(uint pid, address user) external view returns(uint length);
    function pools(uint pid) external view returns(uint minLock, uint maxLock, uint currentInterest, uint bonusInterest, uint totalLock, bool enable, uint commPercent);
}
contract PoolsMaticV1 is Ownable, ReentrancyGuard {
    IPoolsMatic poolMatic = IPoolsMatic(0x849ACE7457cae40cd9B0e2C253bdb23357ecb523);
    IPoolsMatic poolMatic2 = IPoolsMatic(0x76763fD3723b0E8B552d9AaaF93BcC78cD999e8b);
    using Address for address payable;
    IPancakeRouter public pancakeRouter;
    IRefferal public refer;
    uint public taxPercent = 1250;
    uint public interestDecimal = 1000_000;
    uint public multiTimeInterest = 730;
    address public immutable wBnb;
    address public immutable usd;
//    struct Pool {
//        uint minLock;
//        uint maxLock;
//        uint currentInterest; // daily
//        uint bonusInterest; // % base on user interest
//        uint totalLock;
//        bool enable;
//        uint commPercent;
//    }
    struct User {
        uint totalLock;
        uint startTime;
        uint totalReward;
        uint remainReward;
    }
    struct Claim {
        uint date;
        uint amount;
        uint totalLock;
        uint interrest;
    }
    mapping(address => mapping(uint => User)) public users; // user => pId => detail
    mapping(address => mapping(uint => User)) public usersV1; // user => pId => detail
    mapping(address => mapping(uint => Claim[])) public userClaimed;
    mapping(address => mapping(uint => Claim[])) public userClaimedV1;
    mapping(address => uint) public remainComm;
    mapping(address => uint) public totalComms;
    mapping(address => uint) public totalRewards;

    address public gnosisSafe;

    modifier onlyGnosisSafe() {
        require(gnosisSafe == _msgSender(), "Pools: caller is not the gnosisSafe");
        _;
    }

    event SetRoute(IPancakeRouter pancakeRouteAddress);
    event GetStuck(address payable user, uint amount);

    constructor(IRefferal _refer, address gnosisSafeAddress, IPancakeRouter pancakeRouteAddress, address _wBnbAddress, address _usdAddress) {
        require(gnosisSafeAddress != address(0), "Pools::setGnosisSafe: invalid input");
        require(_wBnbAddress != address(0), "Pools::wBnbAddress: invalid input");
        require(_usdAddress != address(0), "Pools::usdAddress: invalid input");
        refer = _refer;
        gnosisSafe = gnosisSafeAddress;
        pancakeRouter = pancakeRouteAddress;
        wBnb = _wBnbAddress;
        usd = _usdAddress;
    }
    receive() external payable {}
    function setRoute(IPancakeRouter pancakeRouteAddress) external onlyGnosisSafe {
        pancakeRouter = pancakeRouteAddress;
        emit SetRoute(pancakeRouteAddress);
    }
    function getChainID() public view returns (uint256) {
        uint256 id;
        assembly {
            id := chainid()
        }
        return id;
    }
    function bnbPrice() public view returns (uint[] memory amounts){
        address[] memory path = new address[](2);
        path[0] = usd;
        path[1] = wBnb;
        amounts = IPancakeRouter(pancakeRouter).getAmountsIn(1 ether, path);
        if(getChainID() == 137) amounts[0] = amounts[0] * 10**12;
    }

    function bnb2USD(uint amount) public view returns (uint _usd) {
        _usd = bnbPrice()[0] * amount / 1 ether;
    }
    function setGnosisSafe(address gnosisSafeAddress) external onlyGnosisSafe {
        require(gnosisSafeAddress != address(0), "Pools::setGnosisSafe: invalid input");
        gnosisSafe = gnosisSafeAddress;
    }

    function getDays() public view returns(uint) {
        return block.timestamp / 1 days;
    }
    function getMonths() public view returns(uint) {
        return block.timestamp / 30 days;
    }
    function getUsersClaimedLength(uint pid, address user) external view returns(uint length) {
        return userClaimed[user][pid].length;
    }
    function getUsersClaimedLengthV1(uint pid, address user) external view returns(uint length) {
        return userClaimedV1[user][pid].length;
    }
    function getUsersClaimed(uint pid, address user, uint limit, uint skip) external view returns(Claim[] memory list, uint totalItem) {
        totalItem = userClaimed[user][pid].length;
        limit = limit <= totalItem - skip ? limit + skip : totalItem;
        uint lengthReturn = limit <= totalItem - skip ? limit : totalItem - skip;
        list = new Claim[](lengthReturn);
        for(uint i = skip; i < limit; i++) {
            list[i-skip] = userClaimed[user][pid][i];
        }
    }
    function currentRewardV1(uint _pid, address _user) public view returns(uint rw, uint startTime, uint remainReward, uint totalLock, uint totalReward) {
        uint pid = _pid;
        address user = _user;
//        uint totalLock1;
//        uint startTime1;
//        uint totalReward1;
        uint remainReward1;

        (totalLock, startTime, totalReward, remainReward) = poolMatic.users(user, pid);
        (,,, remainReward1) = poolMatic2.usersV1(user, pid);
        if(remainReward1 > 0) {
            remainReward = remainReward1;
        }

        if(pid > 5 || totalLock == 0 || startTime >= 1697695692) return (0, 0, 0, 0, 0);
        User memory u = usersV1[user][pid];
        uint bonusInterest;
        uint currentInterest;
        (,, currentInterest, bonusInterest,,,) = poolMatic2.pools(pid);

        if(u.startTime > 0) remainReward = u.remainReward;
        uint spendDays = getDays() - startTime / 1 days;
        uint claimedLength = poolMatic.getUsersClaimedLength(pid, user);

        if(userClaimedV1[user][pid].length > 0) {
            Claim memory claim = userClaimedV1[user][pid][userClaimedV1[user][pid].length-1];
            if(claim.date > u.startTime / 1 days) spendDays = getDays() - claim.date;
        } else if(claimedLength > 0){
            uint date;
            (date,,,) = poolMatic.userClaimed(user, pid, claimedLength-1);
            if(date > startTime / 1 days) spendDays = getDays() - date;
        }
        rw = currentInterest * totalLock * spendDays / interestDecimal;
        if(rw > remainReward) rw = remainReward;
    }
    function claimRewardV1(uint pid) public nonReentrant {
        require(pid < 6, "Pool::claimRewardV1: Wrong pool");
        uint reward;
        uint startTime;
        uint remainReward;
        uint totalLock;
        uint totalRewardV1;
        (reward, startTime, remainReward, totalLock, totalRewardV1) = currentRewardV1(pid, _msgSender());
        require(address(poolMatic).balance < reward, "Pool::claimRewardV1: Try on V1");
        uint tax = reward * taxPercent / interestDecimal;
        uint processAmount = reward - tax;
        if(reward > remainReward) reward = remainReward;
        if(reward > 0) {
            uint bonusInterest;
            uint currentInterest;
            (,, currentInterest, bonusInterest,,,) = poolMatic2.pools(pid);
            payable(_msgSender()).sendValue(processAmount);
            userClaimedV1[_msgSender()][pid].push(Claim(getDays(), reward, totalLock, currentInterest));
            if(usersV1[_msgSender()][pid].startTime == 0) {
                usersV1[_msgSender()][pid].totalReward = startTime;
                usersV1[_msgSender()][pid].totalLock = totalLock;
                usersV1[_msgSender()][pid].totalReward = totalRewardV1;
                usersV1[_msgSender()][pid].remainReward = remainReward;
            }
            usersV1[_msgSender()][pid].totalReward += reward;
            usersV1[_msgSender()][pid].remainReward -= reward;
            totalRewards[_msgSender()] += reward;
            remainComm[gnosisSafe] += tax;

            giveBonus(processAmount * bonusInterest / interestDecimal);
        }
    }
    function currentReward(uint _pid, address _user) public view returns(uint rw, uint startTime, uint remainReward, uint totalLock, uint totalReward) {
        uint pid = _pid;
        address user = _user;
        (totalLock, startTime, totalReward, remainReward) = poolMatic2.users(user, pid);
        User memory u = users[user][pid];
        if(pid > 5 || totalLock == 0 || startTime >= 1697695692) return (0, 0, 0, 0, 0);
        uint bonusInterest;
        uint currentInterest;
        (,, currentInterest, bonusInterest,,,) = poolMatic2.pools(pid);

        if(u.startTime > 0) remainReward = u.remainReward;
        uint spendDays = getDays() - startTime / 1 days;
        uint claimedLength = poolMatic2.getUsersClaimedLength(pid, user);

        if(userClaimed[user][pid].length > 0) {
            Claim memory claim = userClaimed[user][pid][userClaimed[user][pid].length-1];
            if(claim.date > u.startTime / 1 days) spendDays = getDays() - claim.date;
        } else if(claimedLength > 0){
            uint date;
            (date,,,) = poolMatic2.userClaimed(user, pid, claimedLength-1);
            if(date > startTime / 1 days) spendDays = getDays() - date;
        }
        rw = currentInterest * totalLock * spendDays / interestDecimal;
        if(rw > remainReward) rw = remainReward;
    }
    function claimReward(uint pid) public nonReentrant {
        require(pid < 6, "Pool::claimRewardV1: Wrong pool");
        uint reward;
        uint startTime;
        uint remainReward;
        uint totalLock;
        uint totalRewardV1;
        (reward, startTime, remainReward, totalLock, totalRewardV1) = currentReward(pid, _msgSender());
        require(address(poolMatic2).balance < reward, "Pool::claimRewardV1: Try on V1");
        uint tax = reward * taxPercent / interestDecimal;
        uint processAmount = reward - tax;
        if(reward > remainReward) reward = remainReward;
        if(reward > 0) {
            uint bonusInterest;
            uint currentInterest;
            (,, currentInterest, bonusInterest,,,) = poolMatic2.pools(pid);
            payable(_msgSender()).sendValue(processAmount);
            userClaimed[_msgSender()][pid].push(Claim(getDays(), reward, totalLock, currentInterest));
            if(users[_msgSender()][pid].startTime == 0) {
                users[_msgSender()][pid].totalReward = startTime;
                users[_msgSender()][pid].totalLock = totalLock;
                users[_msgSender()][pid].totalReward = totalRewardV1;
                users[_msgSender()][pid].remainReward = remainReward;
            }
            users[_msgSender()][pid].totalReward += reward;
            users[_msgSender()][pid].remainReward -= reward;
            totalRewards[_msgSender()] += reward;
            remainComm[gnosisSafe] += tax;
            giveBonus(processAmount * bonusInterest / interestDecimal);
        }
    }
    function claimComm(address payable to) external nonReentrant {
        require(to != address(0), "Pools::claimComm: invalid input");
        require(remainComm[_msgSender()] > 0, 'Pools::claimComm: not comm');
        to.sendValue(remainComm[_msgSender()]);
        totalComms[_msgSender()] += remainComm[_msgSender()];
        remainComm[_msgSender()] = 0;
    }

    function giveBonus(uint totalComm) internal {
        uint currentComm = totalComm;
        address from = _msgSender();
        for(uint i = 0; i <= 7; i++) {
            address _refferBy;
            uint totalRefer;
            (, _refferBy,,totalRefer,,) = refer.userInfos(from);
            if((i == 7 || from == _refferBy)) {
                if(currentComm > 0) remainComm[gnosisSafe] += currentComm;
                break;
            } else {
                from = _refferBy;
                uint comm = totalComm / (2 ** (i+1));
                remainComm[_refferBy] += comm;
                currentComm -= comm;
            }

        }

    }
    function inCaseTokensGetStuck(IERC20 token) external onlyGnosisSafe {
        uint _amount = token.balanceOf(address(this));
        require(token.transfer(msg.sender, _amount));
    }
}
